  `is_recommend` int(1) NOT NULL COMMENT '推荐视频 0不推荐、1推荐',
  `virtual_number` int(11) NOT NULL COMMENT '最大虚拟人数',
  `room_title` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '直播间名称',
