  `video_status` tinyint(1) NOT NULL COMMENT '//视频当前状态, 0:无状态 、1：已保存、2：有分片、3：分片已合并、4：合并完成已删除分片，5：拉取完成',
  `vodtaskid` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '//任务id，用户根据此字段匹配服务端事件通知',
  `file_id` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '//腾讯云 的 视频ID',
  `source_url` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '//拉流原视频地址'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='直播历史表';

