amily:宋体;\">7.2&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户购买相关收费服务后，可将相关收费服务按照小百合直播运营规则使用。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">7.3&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户确认，虚拟道具或服务一经购买成功， 除法律法规明确规定外，<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>不予退款。用户已购买的任何收费服务不能以任何理由退购或调换成其他服务。用户亦不得将账号中的虚拟道具或服务直接转让给第三人账号。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">7. 4&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户确认，小百合直播充值服务只能在小百合直播官方平台或小百合直播指定的第三方平台上充值,不得通过不符合小百合直播运营规则的渠道获取服务，小百合直播平台有权对不符合小百合直播运营规则的账号虚拟道具或服务予以冻结。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">7.5&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户同意，任何用户因作弊或者其他违反<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>平台规则导致被永久冻结或封号的构成本协议的根本违约，用户账户中所涉及的虚拟道具一概不予退回，账户中的道具分成亦无权主张退回。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><b><span style=\"font-size:14pt;font-family:宋体;\">八、知识产权</span></b><b><span color:black;background:white;\"=\"\" style=\"font-size: 14pt;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">8.1&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">小百合直播对小百合直播内所包含的文字、软件界面、交互等元素，小百合直播服务标志、标识以及专利权，小百合直播服务商小百合直播对此享有上述知识产权。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">8.2&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户不得对小百合直播产品进行反向工程、反向汇编、反向编泽等。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">8.3&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户使用小百合直播只能在本协议以及相应的授权许可协议授权的范围使用小百合直播知识产权,未经授权超范围使用的构成对<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>的侵权。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">8. 4&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户在使用小百合直播服务时发布上传的文字、图片、视频、软件以及表演等用户原创的信息，此部分信息的知识产权归用户，但用户的发表、上传行为是对<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>的授权，用户确认其发表、上传的信息非独占性、永久性的授权，该授权可转授权。<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>可将前述信息在千秀公司旗下的服务平台上使用，可再次编辑后使用，也可以由小百合直播授权给合作方使用。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">8.5&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">若小百合直播内的信息以及其他用户，上传、存储、传播的信息有侵犯的用户或第三人的知识产权的，小百合直播提供投诉通道。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">8.6&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户通过小百合直播服务观看到的在线教学、表演分享等信息内容由相应的主播提供，主播已与服务商<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>签订协议将内容授权给小百合直播，并保证用户浏览、接受小百合直播服务不侵犯内容涉及的第三方知识产权。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><b><span style=\"font-size:14pt;font-family:宋体;\">九、隐私保护</span></b><b><span color:black;background:white;\"=\"\" style=\"font-size: 14pt;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">9.1&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">请用户注意勿在使用<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>服务中透露自己的各类财产帐户、银行卡、信用卡、第三方支付账户及对应密码等重要要资料，否则由此带来的任何损失由用户自行承担。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">9.2&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">用户在使用小百合直播服务时不可将自认为隐私的信息发表、上传至小百合直播，也不可将该等信息通过小百合直播传播给其他人，若用户的行为引起的隐私泄漏，由用户承担责任。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">9.3&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">小百合直播在提供服务时可能会搜集用户信息，<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>会明确告知用户，通常信息仅限于姓名、性别、年龄、出生日期、身份证号、家庭住址、教育程度、公司情况、所属行业、兴趣爱好等。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">9.4&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">就下列相关事宜的发生，<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>不承担任何法律责任:</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">9.4.1&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">小百合直播根据法律规定或相关政府、司法机关的要求提供您的个人信息;</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">9.4.2&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">由于用户将用户密码告知他人或与他人共享注册帐户，由此导致的任何个人信息的泄漏，或其他非因小百合直播原因导致的个人信息的泄漏;</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">9.4.3</span><span style=\"font-size:14pt;font-family:宋体;\">任何由于黑客攻击、电脑病毒侵入造成的信息泄漏;</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">9.4.4&nbsp;</span><span style=\"font-size:14pt;font-family:宋体;\">因不可抗力导致的信息泄漏</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"background:white;\">\r\n	<b><b><span style=\"font-size:14pt;font-family:宋体;\">十、其他条款</span></b><b><span color:black;background:white;\"=\"\" style=\"font-size: 14pt;\"></span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">10. 1</span><span style=\"font-size:14pt;font-family:宋体;\">本协议条款的签订、解释以及争议的解决均适用中华人民共和国法律。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">10.2</span><span style=\"font-size:14pt;font-family:宋体;\">本协议的签署地点为<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>服务器所在地即成都，若用户与小百合直播发生法律争议的，双方同意将争议提交成都仲裁委员会仲裁解决。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">10.3</span><span style=\"font-size:14pt;font-family:宋体;\">本办议在小百合直播注册登录页面及官网展示，对用户和小百合直播服务商<b><span style=\"font-size:14pt;font-family:宋体;\">小百合直播</span></b>具有法律约束力，用户在注册登录页面接受本协议以及使用小百合直播的行为均视为对本协议的接受，对用户具有法律约束力。</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><b><span style=\"font-size:14pt;font-family:宋体;\">&nbsp;</span></b> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14pt;font-family:宋体;\">&nbsp;</span> </b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"background:white;\">\r\n	<b><b><span color:black;background:white;\"=\"\" style=\"font-size: 14pt;\">&nbsp;</span></b> </b> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div>\r\n	<br />\r\n<br />\r\n<br />\r\n</div>', 2, 1470874836, 1547135433, 0, 1, '', 0, 0, 0, 1, '', '', '', '', '', '', 1, 1, '', '麻辣TV', '隐私政策'),
