INSERT INTO `fanwe_article` (`id`, `title`, `content`, `cate_id`, `create_time`, `update_time`, `add_admin_id`, `is_effect`, `rel_url`, `update_admin_id`, `is_delete`, `click_count`, `sort`, `seo_title`, `seo_keyword`, `seo_description`, `uname`, `sub_title`, `brief`, `is_week`, `is_hot`, `icon`, `writer`, `tags`) VALUES
(54, '小百合直播用户行为规范', '<p class=\"MsoListParagraph\" style=\"margin-left:43.1pt;text-align:left;text-indent:-36.0pt;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"><span>一、<span>&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">概述</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">1.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">为了加强对小百合直播平台视频业务管理，给小百合直播用户提供一个健康和谐的才艺展示与欣赏平台，依据公司（小百合直播）制定的《小百合直播平台服务协议》、《小百合直播与文明公约》，制动本办法。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">1.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本办法所指的视频业务包括娱乐类直播、教育类直播、游戏类直播等小百合直播平台上的所有视频业务。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">1.3</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本办法适用于在小百合直播及相关产品上进行的视频、图片、语音和文字类的主播与用户。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">1.4</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本规范的所有内容约束小百合直播平台所有主播和用户，所有主播含签约主播均接受此规范约束，对此规范小百合直播官方拥有解释权。<span></span></span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:43.1pt;text-align:left;text-indent:-36.0pt;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"><span>二、<span>&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">主播与用户的行为规范</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2.1.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">小百合直播主播必须遵守以下规定，否则将收到处罚，违规情节严重程度是由小百合直播官方依据违规意图、违规时间和违规主体等客观因素来进行综合评定的。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2.2.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">严禁进行反党反政府或带有侮辱诋毁党和国家的行为，例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）违反宪法确定的基本原则的；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>3</span>）损害国家荣誉与利益；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>4</span>）煽动民族仇恨、民族歧视、破坏民族团结的；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>5</span>）破坏国家宗教政策，宣扬邪教和封建迷信的；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>6</span>）散布谣言，扰乱社会秩序，破坏社会稳定的；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>7</span>）散布暴力、恐怖，或者教唆犯罪的；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>8</span>）煽动非法集会、结社、游行、示威、聚众扰乱社会秩序的；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>9</span>）其他可能引起或已经引起不良影响的政治话题。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2.2.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">严禁直播违反国家法律法规的内容，例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）展示毒品样品、表演及传播毒品吸食或注射方式，讲解毒品制作过程等一切与毒品相关的内容；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）组织、宣传、诱导用户加入传销（或有传销嫌疑的）机构；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>3</span>）与赌博或涉嫌赌博的任何活动；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>4</span>）播放自己或他人的腐朽、低级趣味活动，如享受不道德的、腐朽的消费等；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>5</span>）其他低俗涉黄行为。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2.2.3</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">严禁进行威胁生命健康，或利用枪支刀具表演，例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）使用刀具、仿真刀具、枪支、仿真枪支、表演具有高度危险性的节目等；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）表演危害他人人身安全的内容，如：殴打他人、威胁他人等；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>3</span>）表演危害自身安全的内容，如：自残自杀等；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>4</span>）表演危害动物生命健康的内容，如：虐待小动物等；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>5</span>）其他威胁生命健康的表演。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2.2.4</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">严禁侵犯他人合法权益，例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）侵犯他人的隐私，危机公众利益，未经当事人同意，禁止公开他人姓名、住址、电话等个人资料、进行任何形式的采访、与公众进行互动及其他隐私信息；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）使用文字、语音、图片等任何形式宣传其他同类型语音、视频平台；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>3</span>）播放未经授权播放的影视作品；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>4</span>）进行其他侵害他人合法权益的行为；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>5</span>）冒充媒体、电视台、记者等名义进行直播活动；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>6</span>）发布广告信息：包括所有违反国家法律及小百合直播相关 管理规则的信息。如：赌博类、博彩类、刷<span>QB</span>、钻石等、成人用品类、枪支、军刀、弓弩类、成人影视类、云盘类广告、性用品、保健品类、香烟广告、非法性药品广告和性病治疗广告等相关内容。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2.2.5</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">严禁以任何形式表演带有色情、涉黄擦边、引起他人性欲、低级趣味的内容，例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）通过各种方式展示或隐晦展示具有性特征的身体敏感部位，例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">a.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">将镜头刻意聚焦性敏感部位；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">b.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">进行带有性暗示的抚摸、拉扯等动作；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">c.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">其他性暗示行为。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）传播具有性行为、性挑逗或性侮辱内容的任何信息；例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">a.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">传播侵犯他人隐私的走光、偷拍、漏点等信息；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">b.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">传播招嫖、一夜情、换妻、性虐待等有害信息；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">c.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">传播情色游戏、动漫；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">d.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">传播淫秽、低俗网站；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">e.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">传播涉黄、带有性挑逗的图片、言论、歌曲、文字、视频、声音等内容。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2.2.6</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">严禁进入易涉黄娱乐场所直播，例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）严禁进入洗浴中心、娱乐中心等容易产生低俗氛围的场所进行直播；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）严禁进入有或疑似有宣传招嫖行为的场所进行直播；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>3</span>）在户外直播中，主播在注意个人行为规范的同时，也需尽量避免镜头中出现其他路人（非本人）的违规行为，如路人吸烟、男性赤裸上身、着装过于暴露等内容。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2.2.7</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">其他规范要求<span>:</span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）严禁以低俗、暴露、带有明显性暗示的妆容进行直播，例如：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">a.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">男性赤裸上身<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">b.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">女性穿着过于暴露、如露出胸部、臀部、内衣物等敏感部位；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">c.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">穿着情趣制服、情趣内衣、暴露装、透视装、肉色紧身衣、内衣外穿等；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">d.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">穿着带有中华人民共和国（包含港澳台）国家机关人员、军队的工作制服进行娱乐性质直播；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">e.</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">其他不雅妆容。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）严禁进行其他类涉政、涉黄、违法、侵权或威胁生命健康等其他类型违反小百合直播相关秩序的表演；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>3</span>）严禁在直播镜头前公然抽烟；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:7.1pt;text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>4</span>）严禁恶意攻击他人，包括谩骂、诽谤、地域攻击等。<span></span></span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:43.1pt;text-align:left;text-indent:-36.0pt;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"><span>三、<span>&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">处罚措施的分类说明</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">若主播出现违规行为，已经认定，视情节严重程度进行处罚。分为：<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">严重违规（<span>A</span>类违规）<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">一般违规（<span>B</span>类违规）<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">轻微违规（<span>C</span>类违规）<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.1.1小百合直播</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户必须遵守以下规定，否则将受到处罚，违规情节严重程度是由小百合直播官方依据违规意图、违规时间和违规主体等客观因素来进行综合评定的<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.2.1小百合直播</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户的违规行为包含严重违规行为和一般违规行为<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.2.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">严重违规行为的处罚<span>:</span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）严禁双开<span>/</span>严禁录像<span>/</span>严禁挂照片、播放电影、严禁消极怠工<span>/</span>严禁长时间不欢迎进房用户<span>/</span>严禁长时间不与用户互动（<span>2~3</span>分钟）；严禁主播在直播时以文字、语音、链接、等任何形式宣传外站；引导用户、其他直播去外站、严禁主播在直播时带有涉黄、擦边、涉政；严禁在直播时裸露胸部、臀部、大腿内侧等私密部位，一经发现处以五级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）发布色情信息：个人昵称、个人签名、个人说明类含有色情淫秽信息：包括宣传以及涉嫌宣传裸聊直播间、宣传一夜情、传播色情影音、传播色情播放链接、传播色情频道的<span>id</span>，一经认证，视情节严重程度不同给予个人资料初始化、<span>4</span>级处罚或<span>5</span>级处罚。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>3</span>）发布反动信息：个人昵称、个人签名、个人说明类含有反动信息：包括违反宪法、危害国家安全、损害国家荣誉和利益、破坏民族团结、破坏国家宗教政策、破坏社会稳定、含有国家法律法规禁止的其他内容，一经认证，视情节严重程度给予<span>4</span>级处罚或<span>5</span>级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>4</span>）骗取他人财物：诈骗、骗取他人财物或账号、积分、钻石等虚拟物品，一经认证，视情节严重程度不同给予个人资料初始化、<span>4</span>级处罚或<span>5</span>级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>5</span>）非法交易：通过非官方平台出售、购买、代充钻石等虚拟货币或道具，一经核实，视情节严重程度不同给予个人资料初始化、冻结或扣罚账户资金、<span>4</span>级处罚或<span>5</span>级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>6</span>）扰乱平台秩序：个人使用外挂等辅助工具增加人气、挂机、刷免费礼物等，个人有组织性的煽动人员去其他房间捣乱或发布违规信息；个人有组织性的煽动人员对其他房间或个人进行恶意举报；个人诱导主播违规或对主播进行威胁和恐吓，一经认定，视情节严重程度不同给予个人资料初始化、<span>1</span>级处罚、<span>2</span>级处罚或<span>5</span>级处罚。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.2.3</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">一般违规行为的处罚<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>1</span>）发布广告信息：个人昵称、个人签名、个人说明类含有广告信息：包括宣传以及涉嫌代挂<span>/</span>买卖<span>ID</span>、买卖账号、专业解封、淘宝刷钻、娱乐套件、私服（<span>SF</span>）、外挂、辅助、脚本等信息，一经认定，视情节严重程度不同给予个人资料初始化、<span>1</span>级处罚、<span>2</span>级处罚或<span>4</span>级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>2</span>）发布低俗信息：个人昵称、个人签名、个人说明类含有低俗信息：包括宣传以及涉嫌宣传一些与主流价值观不符、低级趣味如黄色笑话、婚外情等信息，一经认定，视情节严重程度不同给予个人资料初始化、<span>1</span>级处罚、<span>2</span>级处罚或<span>3</span>级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>3</span>）侵犯他人隐私：侵犯他人隐私，危及公众利益，未经当事人同意，公开他人姓名、住址、电话等个人资料及其他隐私信息，并进行网络电话骚扰或鼓动他人骚扰，一经认定，视情节严重程度不同给予个人资料初始化、<span>3</span>级处罚、<span>4</span>级处罚或<span>5</span>级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>4</span>）恶意攻击他人：侮辱、\r\n谩骂或者诽谤他人，侵害他人合法权益的，一经认定，视情节严重程度不同给予个人资料初始化、<span>1</span>级处罚、<span>2</span>级处罚或<span>3</span>级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>5</span>）侵犯版权著作权：剽窃他人作品，未经许可转载或引用他人作品时侵犯版权，一经认定，视情节严重程度不同给予个人资料初始化、<span>1</span>级处罚、<span>2</span>级处罚或<span>3</span>级处罚；<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（<span>6</span>）恶意举报：对其他房间和个人进行恶意举报，一经认定，视情节严重程度不同给予个人资料初始化、<span>1</span>级处罚、<span>2</span>级处罚或<span>3</span>级处罚。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.2.4 A</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">类处罚：<span>5</span>级账号处罚，并扣除当月全部佣金和分成收益，<span>4</span>级处罚扣除所有佣金底薪；<span>B</span>、<span>C</span>类处罚：依据情况进行断流警告、<span>1-3</span>级账号处罚、限制直播功能等处罚。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.3.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">主播账号处罚规则：<span>1</span>级处罚：冻结账号<span>7</span>天、<span>2</span>级处罚：冻结账号<span>30</span>天、<span>3</span>级处罚：冻结账号<span>120</span>天、<span>4</span>级处罚：冻结账号<span>360</span>天、<span>5</span>级处罚：永久冻结账号。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.4.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">若用户出现违规行为，一经认定，根据处罚措施的轻重程度不同分为：<span>1</span>级处罚：冻结账号<span>7</span>天、<span>2</span>级处罚：冻结账号<span>30</span>天、<span>3</span>级处罚：冻结账号<span>120</span>天、<span>4</span>级处罚：冻结账号<span>360</span>天、<span>5</span>级处罚：永久冻结账号。、<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.5.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">账号纠正与处罚措施的分类说明<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.5.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">纠正是指系统对带有违规信息的账号进行个人信息初始化的操作。且资料被初始化的用户在<span>7</span>天内无法对个人信息进行修改，包括：<span>a.</span>清空个人昵称<span>b.</span>清空签名内容<span>c.</span>清空个人说明内容<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.6.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">违规的情节严重程度是由小百合直播官方根据违规意图、违规时间、违规主体等客观因素进行综合评定的、<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.6.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">违规意图区分为主动违规和被动违规，主动违规是指用户主动发生的违规行为；被动违规是指用户账号被盗，由他人使用该账号发生的违规行为<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">3.6.3</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">违规时间区分为长期违规和短期违规，长期违规是指用户一定时间内连续发生或者持续时间较长的违规行为，短期违规是指用户一定时间内未连续发生或持续时间较短的违规行为。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">四、备注<span></span></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">4.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本管理办法由小百合直播颁布，最终解释权归小百合直播所有，小百合直播有权对本办法进行修改和公示<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">4.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本办法自发布之日起生效。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:right;background:white;\" align=\"right\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">2018</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">年<span>11</span>月<span>20</span>日<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">&nbsp;</span></b> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:43.1pt;text-align:left;text-indent:-36.0pt;\" align=\"left\">\r\n	<br />\r\n</p>', 10, 1534728693, 1547135526, 0, 1, '', 0, 0, 0, 1, '', '', '', '', '', '', 0, 0, '', '', '');
INSERT INTO `fanwe_article` (`id`, `title`, `content`, `cate_id`, `create_time`, `update_time`, `add_admin_id`, `is_effect`, `rel_url`, `update_admin_id`, `is_delete`, `click_count`, `sort`, `seo_title`, `seo_keyword`, `seo_description`, `uname`, `sub_title`, `brief`, `is_week`, `is_hot`, `icon`, `writer`, `tags`) VALUES
(55, '小百合直播用户许可及服务协议', '<p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-36.0pt;\">\r\n	<b><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"><span>一、<span>&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">重要须知</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">1.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">您欲下载安装<span>小百合直播</span>，必须事先阅读（未成年人应该在监护人陪同下阅读），充分理解本《<span>小百合直播</span>用户许可及服务协议》（下称</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">“</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本协议</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">”</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）中各条款，包括免除或者限制<span>小百合直播</span>责任的免责条款及对用户权利限制条款。如您不同意本服务条款您应不使用或主动取消<span>小百合直播</span>提供的服务，您的使用行为将被视为您对本服务条款全部的完全接受。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">1.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">在您接受本协议之后，此文本可能因国家政策、产品以及履行本协议的环境发生变化而进行修改，修改后的协议发布在<span>小百合直播</span>所有产品（包括但不限于</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">APP</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">、网站、</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">PC</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">客户端）上，若您对修改后的协议有异议的，请立即停止访问、使用<span>小百合直播</span>，您的继续访问或使用的行为，视为对修改后的协议予以认可。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">1.3</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\"><span>小百合直播</span>目前向用户提供丰富的互联网服务，包括实时视频直播、图文分享等，如果某一特定服务具有单独的服务条款、规则、指引，用户须遵守该单独的服务条款、规则和指引，用户在接受单独的服务条款、规则和指引的同时，应遵守本协议。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-36.0pt;\">\r\n	<b><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"><span>二、<span>&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">服务范围</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">2.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\"><span>小百合直播</span>是一款为用户提供实时视频直播、图文分享等服务的软件。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">2.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户在接受</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">2.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">的服务时，须遵守本协议。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">三、用户使用规则</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">3.1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户须充分了解并同意，用户在<span>小百合直播</span>上的注册信息的真实性、合法性、有效性承担全部责任，用户不得冒充他人、不得利用他人名义传播任何信息、不得恶意使用注册账号导致其他用户误认、不得恶意误导他人、否则本公司有权立即停止提供服务，并由用户独自承担由此而产生的一切法律责任。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">3.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户须对自己注册账号下的一切行为负责并承担法律后果，包括直播的视频、发表或传播的文字信息等等，用户须保证在<span>小百合直播</span>上所传播信息的真实性、合法性、无害性及有效性，同时保证该信息不侵犯任何第三方的知识产权，不得利用本服务制作、复制、发布、传播、储存含有下列内容的信息：</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）反对宪法所确定的基本原则的；</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">3</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）损害国家荣誉和利益的；</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">4</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）煽动民族仇恨、民族歧视，破坏民族团结的；</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">5</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）破坏国家宗教政策，宣扬邪教和封建迷信的；</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">6</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）散布谣言，扰乱社会秩序，破坏社会稳定的；</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">7</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）散布淫秽、色情、低俗、猥亵、暴力、凶杀、恐怖、教唆犯罪或其他道德上令人反感的内容；</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">8</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）侮辱或诽谤他人，侵害他人知识产权、商标权、商业秘密、肖像权、名誉权、荣誉权、名称权、姓名权、隐私权等合法的人身和财产权益</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"> </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">；</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">（</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">9</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">）含有法律、行政法规、规章、条例以及任何具有法律效力之规范所限制或禁止的其他内容的。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">3.3 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户不得利用<span>小百合直播</span>服务进行任何诸如发布广告，销售商品的商业行为，或者进行任何非法的侵害<span>小百合直播</span>利益的行为，如贩卖秀豆、游戏币、外挂、道具等</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">3.4 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户从<span>小百合直播</span>上接收到的一切内容均由其他机构或网友发布、传播，其内容不代表本公司的观点或政策。用户在使用<span>小百合直播</span>提供的内容时需要自行判断，并承担因使用这些内容而引起的所有风险，本公司无法且不会对因用户行为而导致的任何损失</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"> </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">和损害承担责任。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">3.5 <span>小百合直播</span></span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">提供的服务中可能会包含广告，用户须同意在使用过程中显示<span>小百合直播</span>和第三方供应商、合作伙伴提供的广告。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\">3.6 <span>小百合直播</span></span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">保留在不通知用户的情况下中止全部或部分服务的权利，用户须自行承担此风险。</span><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">四、关于<span>小百合直播</span></span></b><span style=\"font-size:14.0pt;font-family:\" color:black;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">4.1 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户可以为非商业目的单一台终端设备上安装、使用、显示、运行<span>小百合直播</span>，用户不得为商业运营目的安装、使用、运行<span>小百合直播</span>，不可以对该软件或者该软件运行过程中释放任何到任何计算机终端内存中的数据及该软件运行过程中客户端与服务器端的交互数据\r\n进行复制、修改、挂接运行或创作任何衍生作品，形式包括但不限于使用插件、外挂或非经授权的第三方工具<span>/</span>服务接入<span>小百合直播</span>和相关系统。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">4.2 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户不得未经<span>小百合直播</span>服务商许可，将<span>小百合直播</span>安装在未经明示许可的其他终端设备上。包括但不限于机顶盒、手持设备、电话、无线上网机游戏机、电视机、<span>DVD</span>机等<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">4.3 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">保留权利：未明示授权的其他一切权利仍归本公司所有，用户使用其