	<span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\">6.5 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">用户需对注册账号以及密码下的行为负责，任何在用户账号密码下的操作行为将视为用户本人的行为，用户对本人的行为承担全部的责任。</span><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\">6.6 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">用户同意在任何情况下不使用其他用户的账号或密码，在用户怀疑他人使用账号或密码时，用户同意立即通知<span>小百合直播</span>。</span><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\">6.7 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">用户通过手机号码注册账号或者在使用小百合直播产品中绑定了手机号码，视为用户同意<span>小百合直播</span>服务商可以将业务通知信息及营销信息通过短信的形式发送到用户手机上。</span><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">七、收费服务</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">7.1 <span>小百合直播</span></span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">提供的服务包含免费服务与收费服务。用户可以通过付费方式购买收费服务。对于收费服务，我们会在用户使用之前给予用户明确的提示，只有用户根据提示确认其同意按照前述支付方式支付费用并完成了支付行为，用户才能使用该等收费服务。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">7.2 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户购买相关收费服务后，可将相关收费服务按照<span>小百合直播</span>运营规则使用。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">7.3 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户确认，虚拟道具或服务一经购买成功， 除法律法规明确规定外，本平台不予退款。用户已购买的任何收费服务不能以任何理由退购或调换成其他服务。用户亦不得将账号中的虚拟道具或服务直接转让给第三人账号。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">7. 4 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户确认，<span>小百合直播</span>充值服务只能在<span>小百合直播</span>官方平台或<span>小百合直播</span>指定的第三方平台上充值<span>,</span>不得通过不符合<span>小百合直播</span>运营规则的渠道获取服务，<span>小百合直播</span>平台有权对不符合直播运营规则的账号虚拟道具或服务予以冻结。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">7.5 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户同意，任何用户因作弊或者其他违反本直播平台规则导致被永久冻结或封号的构成本协议的根本违约，用户账户中所涉及的虚拟道具一概不予退回，账户中的道具分成亦无权主张退回。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">八、知识产权</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">8.1 本</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">公司对<span>小百合直播</span>内所包含的文字、软件界面、交互等元素，公司服务标志、标识以及专利权，公司对此享有上述知识产权。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">8.2 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户不得对<span>小百合直播</span>产品进行反向工程、反向汇编、反向编泽等。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">8.3 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户使用<span>小百合直播</span>只能在本协议以及相应的授权许可协议授权的范围使用<span>小百合直播</span>知识产权<span>,</span>未经授权超范围使用的构成对<span>小百合直播</span>的侵权。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">8. 4 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户在使用<span>小百合直播</span>服务时发布上传的文字、图片、视频、软件以及表演等用户原创的信息，此部分信息的知识产权归用户，但用户的发表、上传行为是对<span>小百合直播</span>的授权，用户确认其发表、上传的信息非独占性、永久性的授权，该授权可转授权。<span>小百合直播</span>可将前述信息在千秀公司旗下的服务平台上使用，可再次编辑后使用，也可以由<span>小百合直播</span>授权给合作方使用。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">8.5 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">若<span>小百合直播</span>内的信息以及其他用户，上传、存储、传播的信息有侵犯的用户或第三人的知识产权的，本公司提供投诉通道。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">8.6 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户通过<span>小百合直播</span>服务观看到的在线教学、表演分享等信息内容由相应的主播提供，主播已与服务商本公司签订协议将内容授权给本公司，并保证用户浏览、接受<span>小百合直播</span>服务不侵犯内容涉及的第三方知识产权。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">九、隐私保护</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">9.1 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">请用户注意勿在使用直播服务中透露自己的各类财产帐户、银行卡、信用卡、第三方支付账户及对应密码等重要要资料，否则由此带来的任何损失由用户自行承担。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">9.2 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">用户在使用直播服务时不可将自认为隐私的信息发表、上传至<span>小百合直播</span>，也不可将该等信息通过路密码直播传播给其他人，若用户的行为引起的隐私泄漏，由用户承担责任。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">9.3 <span>小百合直播</span></span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">在提供服务时可能会搜集用户信息，公司会明确告知用户，通常信息仅限于姓名、性别、年龄、出生日期、身份证号、家庭住址、教育程度、公司情况、所属行业、兴趣爱好等。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">9.4 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">就下列相关事宜的发生，<span>小百合直播</span>不承担任何法律责任<span>:</span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">9.4.1 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\"><span>小百合直播</span>根据法律规定或相关政府、司法机关的要求提供您的个人信息<span>;</span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">9.4.2 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">由于用户将用户密码告知他人或与他人共享注册帐户，由此导致的任何个人信息的泄漏，或其他非因本公司原因导致的个人信息的泄漏<span>;</span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">9.4.3</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">任何由于黑客攻击、电脑病毒侵入造成的信息泄漏<span>;</span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">9.4.4 </span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">因不可抗力导致的信息泄漏<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"background:white;\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">十、其他条款</span></b><b><span style=\"font-size:14.0pt;font-family:\" color:black;background:white;\"=\"\"></span></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"background:white;\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">10. 1</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本协议条款的签订、解释以及争议的解决均适用中华人民共和国法律。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">10.2</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本协议的签署地点为<span>小百合直播</span>服务器所在地即吉林，若用户与本公司发生法律争议的，双方同意将争议提交成都仲裁委员会仲裁解决。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;color:black;\">10.3</span><span style=\"font-size:14.0pt;font-family:宋体;color:black;\">本办议在<span>小百合直播</span>注册登录页面及官网展示，对用户和<span>小百合直播</span>服务商<span>小百合直播</span>具有法律约束力，用户在注册登录页面接受本协议以及使用<span>小百合直播</span>的行为均视为对本协议的接受，对用户具有法律约束力。<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;background:white;\" align=\"left\">\r\n	<b><span style=\"font-size:14.0pt;font-family:宋体;color:black;background:white;\">&nbsp;</span></b> \r\n</p>\r\n<p class=\"Ms