INSERT INTO `fanwe_faq` (`id`, `group`, `question`, `answer`, `sort`, `click_count`, `is_effect`, `is_show`) VALUES
(1, '咨询客服', '如何提现，提现时间多久？', '（1）关注微信服务号“千秀直播”\r\n（2）通过微信，支付宝绑定信息，准确无误后提现申请提现\r\n（3）审核通过后1-2个工作日内到账', 9, 68, 1, 1),
(2, '直播问题', '怎么打开美颜？', '进入直播间后打开房间设置功能，打开美颜即可做出最美的自己。', 10, 31, 1, 1),
(6, '直播问题', '主播怎么成为热门？', '主播上热门是通过收到道具栏标记的“热”字的热门礼物多少来依次排名！得到越多的热门礼物，热一位置就是你哟！', 1, 57, 1, 1),
(8, '账号问题', '为什么总是显示账户信息过期，请重新登录？', '亲爱的用户，如果收到“账号信息已过期”的弹窗提示，请到打开千秀直播，我的个人主页 — 设置 — 退出登录，并重新登录账号或清理手机内存，及关机重启。若还不能解决，请您联系在线客服并详细描述您的问题。', 3, 22, 1, 1),
(11, '直播问题', '开播时怎么使用后置摄像头？', '进入直播间—点击屏幕左下角有“黄圆圈” - 点击“切换”完整此项操作!', 11, 14, 1, 1),
(14, '充值问题', '怎么充值钻石？', '亲，目前只有安卓版本支持微信和支付宝充值，你可以在个人主页 — 我的账户里选择你喜欢的支付方式进行充值或者在观看他人直播时点击礼物—充值。您可以选择不同的档位进行充值。', 17, 19, 1, 1),
(15, '账号问题', '怎么设置管理员？', '在您自己的直播间点击粉丝头像，在弹出的页面点左上角管理—设置管理员，就可以把您喜欢的人设置成管理员了。', 18, 10, 1, 1),
(16, '账号问题', '账号与安全怎么绑定手机号', '点击个人主页 — 设置 — 账号与安全 — 手机绑定手机号，验证码是短信形式发送，就能绑定手机号了！', 19, 7, 1, 1),
(17, '账号问题', '个人主页是什么？', '亲，点击最下方右边的按钮，就进入到我的个人主页中心界面，在这里可以查看到您个人信息，还有收益、等级，等信息。', 20, 8, 1, 1),
(18, '账号问题', '如何更改个人信息？', '请点击个人主页 — 个人资料，进入到个人信息编辑界面，在这里可以更改您的昵称、头像、性别、个性签名。', 21, 3, 1, 1),
(20, '账号问题', '账户可以注销吗？', '亲，千秀直播是第三方快捷登陆的，所以账号是不可以注销的。每一种登陆方式都是一个全新的千秀直播号，您想要其他账号您可以更换其他方式登陆哦。', 23, 5, 1, 1),
(21, '账号问题', '登陆失败怎么办？', '登陆失败建议您关闭app、切换网络试一下，重新登陆即可。', 24, 3, 1, 1),
(22, '直播问题', '为什么直播时脸是反的', '亲，千秀直播是在手机上进行的。使用（镜像)功能直播的时候就相当于在照镜子一样，所以说才会看到感觉脸是反的。', 25, 6, 1, 1),
(23, '直播问题', '提示相机不可用', '安卓用户在手机设置里找到权限管理，找到千秀直播打开所有相机权限就可以了；ios用户在审核设置 — 隐私 —\r\n 相机 — 打开千秀直播相机权限就可以了。', 26, 6, 1, 1),
(25, '直播问题', '直播没有人看怎么办？', '多多直播，多一份努力，让自己的直播诙谐有趣，千秀直播就是这么好玩，你可以拉朋友一起嗨；多和粉丝互动，培养自己的粉丝群；您也可以和其他主播小伙伴多多交流共享经验。超级大主播指日可待！', 28, 7, 1, 1),
(26, '直播问题', '公屏怎么不显示飘屏？', '建议您切换网络、关闭app重新打开试试，网络不稳定的时候会显示延迟。', 29, 15, 1, 1),
(27, '直播问题', '直播时怎么分享其他平台？', '在开始直播前，填写直播标题页面点亮相应的平台图标，就可以分享到其他平台邀请朋友观看直播。在直播中也是可以将自己的直播给朋友们的哦。', 30, 24, 1, 1),
(28, '直播问题', '为什么我开播时好友收不到开播通知？', '安卓用户确认好友的千秀直播否关闭了好友推送，进入个人主页—设置—推送管理—直播消息提醒；ios用户确认好友是否关闭方维互动直播的推送，还需在系统设置里允许通知：设置—通知—选择千秀直播允许通知就可以了。', 31, 34, 1, 1),
(29, '直播问题', '收到骚扰，怎么拉黑？', '点击ta的头像进入ta的主页，右下方点击拉黑即可。', 32, 49, 1, 1),
(30, '直播问题', '怎么关注好友，取消关注？', '进入ta个人主页，页面左下方可以选择关注好友，再次点击已关注就可以取消关注了。', 0, 4, 1, 1),
(32, '充值问题', 'ios充值方式？', 'ios版本app充值只支持AppStore充值。', 15, 17, 1, 1),
(34, '充值问题', '充错账户，点错充值档位怎么办？', '亲， 在购买钻石输入密码前，请仔细确认充值的ID号及金额后再购买。 若错充等将无法退还，还请您务必小心操作哦。', 1, 13, 1, 1),
(35, '充值问题', '微信支付宝提示充值超限怎么办？', '亲，千秀直播没有限制充值金额，你的银行卡是有限额的，请你查看绑定银行卡的限额，建议您提高一下您银行卡的支付限额。', 6, 8, 1, 1),
(36, '充值问题', '充值成功钻石没有到,怎么办？', '充值未到账请您点击设置-帮助与反馈-关于我们，添加官方客服微信并提供以下资料，方便我们核实及处理。\r\n1.千秀直播ID号\r\n2.充值日期、充值时间是上午、下午或是晚上，大概是几点\r\n3.千秀直播版本号是多少（在个人主页设置内查看）\r\n4.提交您交易账单的截图（苹果app store充值在绑定苹果ID的邮箱里查看明细账单）\r\n5.请您详细说明具体一共几笔没有到账过，未到账的金额各是多少。充值未到账请您点击设置-帮助与反馈-关于我们，添加官方客服微信并提供以下资料，方便我们核实及处理。\r\n6.核实需要24小时的审核阶段，请耐心等候', 1, 15, 1, 1),
(39, '直播问题', '主播怎么申请开播及认证？', '打开千秀直播 — 个人主页 — 我的认证 — 填写相关信息（确保身份信息准确无误）— 提交即可。', 36, 6, 1, 1),
(41, '账号问题', '怎么修改密码？', '亲，暂无修改密码。请通过手机验证码登陆，或是微信登陆！', 38, 5, 1, 1),
(46, '咨询客服', '如何联系客服？', '添加在线客服微信；LHT812219', 43, 8, 1, 1),
(47, '咨询客服', '客服电话', '400', 44, 15, 1, 1),
(52, '咨询客服', '客服服务内容', '回复直播中相关问题！', 49, 7, 1, 1),
(53, '咨询客服', '客服上班时间', '早上10:00 - 晚上22 : 00', 50, 14, 1, 1),
(55, '账号问题', '保证账号安全度，避免盗号的情况！', '账号及密码是由于个人设置的，如涉及到账号及密码被盗时，官方查询不到你设置的任何有关密码的信息。 请务必要保证账号与密码的安全性！', 52, 15, 1, 1),
(57, '主播招聘', '主播招聘', '只要你对自己有信心，就能点击认证加入我们！千秀直播欢迎你们', 54, 8, 1, 1),
