(6, 104, '611803179', 'http://zhangmenshiting.qianqian.com/data2/music/814697548e4b2933f4506bec4f984e45/611803225/61180317997200128.mp3?xcode=b3feddbaa3a9c39abdfb5657fcf2438e', '', '记录', '白小桃', 1548401015, 238, 0, 0, '记录\r\n\r\n作词作曲：白小桃\r\n演唱录音：白小桃\r\n后期合成：白小桃\r\n企划：音尚律动\r\n发行：爱原创\r\n\r\n我记录 一些歌词 记录一些故事\r\n用一首歌的说辞拼成可以说的故事\r\n这故事 用你会喜欢的方式\r\n去拼凑 去拼成 你会熟悉的故事\r\n\r\n我记录 一些歌词 记录一些故事\r\n用一首歌的说辞拼成可以说的故事\r\n这故事 用你所喜欢的方式\r\n去拼凑 去拼成 你所熟悉的故事\r\n\r\n有太多的歌词没有拼成善意的歌\r\n我幼稚的真心一直被恶意对待着\r\n被谎言所欺骗 被刺痛的思念\r\n被自己的双眼蒙蔽不愿意去看见\r\n\r\n我听过 太多音乐不中听\r\n写过太多的流行可它不流行\r\n一份努力的泪水滑落像流星\r\n划过夜里的痕迹早已看不清\r\n\r\n我记录 一些歌词 记录一些故事\r\n用一首歌的说辞拼成可以说的故事\r\n这故事 用你所喜欢的方式\r\n去拼凑 去拼成 你所熟悉的故事\r\n\r\n我记录 一些歌词 记录一些事\r\n记住那些受到过的伤害是尖锐的刺\r\n记住谎言与欺骗 被刺痛的思念\r\n被玩弄的真心和践踏过的伊甸\r\n\r\n我知道 你在夜里寻找一份怀抱\r\n我知道 你努力过没有受到回报\r\n我知道 你的善意曾经被人践踏\r\n也知道 你的真心被人问过贱吗\r\n你知道 真心不一定会换来真心\r\n也知道 真心实意不会换来倾听\r\n你知道 善良的人无法保护自己\r\n可知道 那是一份真的真心\r\n\r\nSo 你来保护他们 我来保护你们的心\r\n那没人在意的心就由我来用心倾听\r\n用坚强的意志维持一个强健的心\r\n用真实的自己维制被挫败的真心\r\n\r\n用真实的想法构建你强健的意志\r\n用诚挚的爱来表达没挫败时既是\r\n生活的坎坷不会再能将你打倒\r\n被恶意的对待你也能将它干掉\r\n\r\n我记录 一些歌词 记录一些故事\r\n用一首歌的说辞拼成可以说的故事\r\n这故事 用你所喜欢的方式\r\n去拼凑 去拼成 你所熟悉的故事\r\n\r\n我记录 一些歌词 记录一些事\r\n记住那些受到过的伤害是尖锐的刺\r\n记住谎言与欺骗 被刺痛的思念\r\n被玩弄的真心和践踏过的伊甸 X2\r\n\r\n在成长的路上闯关 完成所有任务\r\n扮演着不同的角色 也遇到过很多人物\r\n有惊喜 有感动 有想不到的事故\r\n所有的经历经验 都成为一种记录\r\n\r\n不害怕去冒险 不畏惧所有困难\r\n迎接所有的挑战 收起软弱的泪腺\r\n简单的日子一样可以过得光鲜\r\n谁都不能及的坚强应该让所有人看见\r\n\r\n记录所有的故事 所有的歌词\r\n用你的方式 唱一次\r\n\r\n我记录 一些歌词 记录一些故事\r\n用一首歌的说辞拼成可以说的故事\r\n这故事 用你所喜欢的方式\r\n去拼凑 去拼成 你所熟悉的故事\r\n\r\n我记录 一些歌词 记录一些事\r\n记住那些受到过的伤害是尖锐的刺\r\n记住谎言与欺骗 被刺痛的思念\r\n被玩弄的真心和践踏过的伊甸 X2\r\n\r\n(记录所有的故事 所有的歌词\r\n用你的方式 唱一次 X4)', 0),
(7, 104, '611803178', 'http://zhangmenshiting.qianqian.com/data2/music/52706f2e4b8700681fd88128870384b7/611803192/61180317893600128.mp3?xcode=b3feddbaa3a9c39ab50a78e8b32aeef1', '', '呼啦啦', '白小桃', 1548401020, 215, 0, 0, '呼啦啦\r\n\r\n作词作曲：白小桃\r\n录音演唱：白小桃\r\n后期合成：白小桃\r\n企划：音尚律动\r\n发行：爱原创\r\n\r\n呼啦啦~ 呼啦啦~ 世界多美好\r\n呼啦啦~ 呼啦啦~ 对所有人微笑\r\n\r\n换上了新衣服 就有了好心情 \r\n每一天对我来说 都是好风景\r\n不喜新厌旧 我接受所有的你\r\n每一个朋友 都应该学会珍惜\r\n\r\n如果有不开心 就自己唱歌 反正快乐不快乐都要自己过\r\n假如遇到困难 我决不退缩 因为身边有你 有你们陪着我\r\n\r\n呼啦啦~ 呼啦啦~ 世界多美好\r\n呼啦啦~ 呼啦啦~ 对所有人微笑\r\n做最善良的天使 给你们一道光明 这才是我最终的目的\r\n忘记所有的难过 要带给你们快乐 快乐无限的唱歌\r\n\r\n起床第一件事 我就是想要唱歌\r\n唱给所有人 唱给不怕输的自我\r\n带你们一起飞 一起跳舞一起欢乐\r\n这才是青春 属于你我的生活\r\n\r\n抛开你的烦恼 带上你的微笑 这世界还有很多东西值得你拥抱\r\n向对方点点头 握手就交个朋友 要表示友善先伸出你的右手\r\n\r\n呼啦啦~ 呼啦啦~ 世界多美好\r\n呼啦啦~ 呼啦啦~ 对所有人微笑\r\n做最善良的天使 给你们一道光明 这才是我最终的目的\r\n忘记所有的难过 要带给你们快乐 快乐无限的唱歌\r\n\r\n受过的委屈 我自己消化 就当做是考验 我需要长大\r\n学会独立坚强 不管有多难熬 把悲伤丢掉 我始终保持微笑 让你们都看到（你们都会看到）\r\n\r\n呼啦啦~ 呼啦啦~ 世界多美好\r\n呼啦啦~ 呼啦啦~ 对所有人微笑\r\n做最善良的天使 给你们一道光明 这才是我最终的目的\r\n忘记所有的难过 要带给你们快乐 快乐无限的唱歌\r\n\r\n呼啦啦~ 呼啦啦~ 世界多美好\r\n呼啦啦~ 呼啦啦~ 对所有人微笑（微笑）', 0),
